import React, {Component} from 'react';
import $ from 'jquery';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';
import Dropdown from 'react-dropdown'
import 'react-dropdown/style.css'


class SearchTrainings extends Component {
  constructor(props) {
    super(props);

    this.onSelect = this.onSelect.bind(this);

    this.state = {
      options: [
          'one', 'two', 'three'
      ]
    };

  }

  onSelect() {

  }

  componentDidMount() {
  }

  componentDidUpdate() {
  }


  render() {
    const {options} = this.state;

    return (
      <div class="search-trainings-container">
        <h5>Search Trainings</h5>
        <Dropdown options={options} onChange={this.onSelect} value={options} placeholder="Select a technology" />


      </div>
    );
  }
}
export default SearchTrainings;
